import React from "react";
import { BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table';
import FormUpload from './form-upload';
import Pageadmin from 'layouts/page-admin';

class Icons extends React.Component {

  render() {
    const data = [
        {
          id: '1',
          dtupload: '2019/03/28',
          filename: 'document.pdf',
          filesrc: '/file/document.pdf'
        }
      ]

    const options = {
      sizePerPage: 10,
      hideSizePerPage: true,
      prePage: 'Back',
      nextPage: 'Next',
    };
    return (
      <Pageadmin head={'List Upload'}>
        <FormUpload/><br/>
        <div className="row">
          <div className="col-md-12">
              <div className="card">
                <div className="content">
                  <BootstrapTable
                    data={data}
                    bordered={false}
                    striped
                    pagination={true}
                    options={options}>
                      <TableHeaderColumn
                        dataField='id'
                        isKey
                        width="50px"
                        dataSort>
                        ID
                      </TableHeaderColumn>
                      <TableHeaderColumn
                        dataField='name'
                          width="20%"
                          dataSort>
                          Name
                      </TableHeaderColumn>
                      <TableHeaderColumn
                        dataField='email'
                        width="30%">
                        email
                      </TableHeaderColumn>
                      <TableHeaderColumn width="20%"></TableHeaderColumn>
                  </BootstrapTable>
                </div>
              </div>
            </div>
          </div>  
      </Pageadmin>
    );
  }
}

export default Icons;
